  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal align=center style='text-align:center'>Asia es el
    continente más grande y poblado de la Tierra.2&#8203; Con 44,6 millones de
    km² aproximadamente,3&#8203; representa el 8,7 % de la superficie de la tierra[cita
    requerida] y el 30 % de las tierras emergidas.2&#8203; En agosto de 2023
    tiene alrededor de 4757 millones de habitantes, que representan el 59 % de
    la población mundial.4&#8203; Se extiende sobre la mitad oriental del
    hemisferio norte, desde el océano Glacial Ártico, al norte, hasta el océano
    Índico, al sur. Limita, al oeste con los montes Urales (Rusia), y al este
    con el océano Pacífico.</p>
    </div>
